 To sort a dictionary by key in JavaScript, you can use the 'keys' method followed by the 'sort' method to sort the keys. Here's an example with sample data:

```javascript
const myDict = {
  apple: "green",
  banana: "yellow",
  durian: "orange",
  mango: "red"
};

// Use 'keys' method to get the keys in an array
const sortedKeys = Object.keys(myDict).sort();

// Use 'forEach' to loop through the sorted keys and output the values
console.log("Sorted dictionary by key alphabetically:");
sortedKeys.forEach(key => {
  console.log(`${key}: ${myDict[key]}`);
});
```

Output:

```
Sorted dictionary by key alphabetically:
apple: green
banana: yellow
durian: orange
mango: red
```
